/*Data for the table `controller_eventlog_description` */

insert  into `controller_eventlog_description`(`eventType`,`name`,`langCode`,`description`) values 
(0,'Normal Punch Open','eNormalPunchOpen','In [Card Only] verification mode, the person has open door permission punch the card and triggers this normal event of open the door.'),
(1,'Punch during Normal Open Time Zone','ePunchDuringNormalOpenTiemzone','At the normally open period (set to normally open period of a single door or the door open period after the first card normally open), or through the remote normal open operation, the person has open door permission punch the effective card at the opened door to trigger this normal events.'),
(2,'First Card Normal Open (Punch Card)','eFirstCardNormalOpen_Card','In [Card Only] verification mode, the person has first card normally open permission, punch card at the setting first card normally open period but the door is not opened, and trigger the normal event.'),
(3,'Multi-Card Open (Punching Card)','eMulticardOpen_Card','In [Card Only] verification mode, multi-card combination can be used to open the door. After the last piece of card verified, the system trigger this normal event.'),
(4,'Emergency Password Open','eEmergencyPasswordOpen','The password (also known as the super password) set for the current door can be used for door open. It will trigger this normal event after the emergency password verified.'),
(5,'Open during Normal Open Time Zone','eOpenNormalOpenTimezone','If the current door is set a normally open period, the door will open automatically after the setting start time, and trigger this normal event.'),
(6,'Linkage Event Triggered','eLinkageEventTriggered','When the linkage setting the system takes effect, trigger this normal event.'),
(7,'Cancel Alarm','eCancelAlarm','When the user cancel the alarm of the corresponding door, and the operation is success, trigger this normal event.'),
(8,'Remote Opening','eRemoteOpening','When the user opens a door from remote and the operation is successful, it will trigger this normal event.'),
(9,'Remote Closing','eRemoteClosing','When the user close a door from remote and the operation is successful, it will trigger this normal event.'),
(10,'Disable Intraday Normal Open Time Zone','eDisableIntradayNormalOpenTimezone','When the door is in Normally Open (NO) state, swipe your valid card five times through the reader or call ControlDevice to disable the NO period on that day. In this case, trigger this normal event.'),
(11,'Enable Intraday Normal Open Time Zone','eEnableIntradayNormalOpenTimezone','When the door\'s NO period is disabled, swipe your valid card (held by the same user) five times through the reader or call ControlDevice to enable the NO period on that day. In this case, trigger this normal event. '),
(12,'Open Auxiliary Output','eOpenAuxiliaryOutput','If the output point address is set to a specific auxiliary output point and the action type is set enabled in a linkage setting record, then this normal event will be triggered as long as this linkage setting takes effect.'),
(13,'Close Auxiliary Output','eCloseAuxiliaryOutput','Events that are triggered when you disable the auxiliary input through linkage operations or by calling ControlDevice.'),
(14,'Press Fingerprint Open','ePressFingerprintOpen','Normal events that are triggered after any person authorized to open the door presses his fingerprint and passes the verification in \"Fingerprint only\" or \"Card/Fingerprint\" verification modes.'),
(15,'Multi-Card Open (Press Fingerprint)','eMulticardOpen_FP','Multi-card open(Fingerprint required): normal events that are triggered when the last person opens the door with his fingerprint in \"Finger print\" verification mode.'),
(16,'Press Fingerprint during Normal Open Time Zone','ePressFPNormalOpenTimezone','Normal events that are triggered after any person authorized to open the door presses his valid fingerprint during the NO duration (including the NO durations set for single doors and the first-card NO duration) and through remote operations.'),
(17,'Card plus Fingerprint Open','eCardPlusFPOpen','Normal events that are triggered after any person authorized to open the door swipes his card and presses his fingerprint to pass the verification in the \"Card + Fingerprint\" verification mode.'),
(18,'First Card Normal Open (Press Fingerprint)','eFirstCardNormalOpen_FP','Normal events that are triggered after any person authorized to open the door becomes the first one to press his fingerprint and pass the verification during the preset first-card NO duration and in either the \"Fingerprint only\" or the \"Card/Fingerprint\" verification mode.'),
(19,'First Card Normal Open (Card plus Fingerprint)','eFirstCardNormalOpen_CardPlusFP','Normal events that are triggered after any person authorized to open the door becomes the first one to swipe his card and press his fingerprint to pass the verification during the preset first-card NO duration and in the \"Card + Fingerprint\" verification mode.'),
(20,'Punch Interval Too Short','ePunchIntervalTooShort','When the interval between two card punching is less than the interval preset for the door, trigger this abnormal event.'),
(22,'Illegal Time Zone','eIllegalTimezone','The user with the permission of opening the current door, punches the card during the invalid time zone, and triggers this abnormal event.'),
(23,'Access Denied','eAccessDenied','The registered card without the access permission of the current door, punch to open the door, triggers this abnormal event.'),
(24,'Anti-Passback','lAntiPassback','When the anti-pass back setting of the system takes effect, triggers this abnormal event.'),
(25,'Interlock','lInterlock','When the interlocking rules of the system take effect, trigger this abnormal event.'),
(26,'Multi-Card Authentication (Punching Card)','eMultiCardAuthentication_Card','Use multi-card combination to open the door, the card verification before the last one (whether verified or not), trigger this normal event'),
(27,'Unregistered Card','eUnregisteredCard','Refers to the current card is not registered in the system, trigger this abnormal event.'),
(28,'Opening Timeout','eOpeningTimeout','The door sensor detect that it is expired the delay time after opened, if not close the door, trigger this abnormal event'),
(29,'Card Expired','eCardExpired','The person with the door access permission, punch card to open the door after the effective time of the access control, can not be verified and will trigger this abnormal event.'),
(30,'Password Error','ePasswordError','Use card plus password, duress password or emergency password to open the door, trigger this event if the password is wrong.'),
(31,'Fingerprint Pressing Interval Too Short','eFPPressIntervalTooShort','When the interval between two consecutive fingerprints is less than the interval preset for the door, trigger this abnormal event.'),
(32,'Multi-Card Authentication (Press Fingerprint)','eMulticardAuthentication_FP','In either the \"Fingerprint only\" or the \"Card/Fingerprint\" verification mode, when any person presses his fingerprint to open the door through the multi-card access mode and before the last verification, trigger this event regardless of whether the verification attempt succeeds.'),
(33,'Fingerprint Expired','eFPExpired','When any person fails to pass the verification with his fingerprint at the end of the access control duration preset by himself, trigger this event.'),
(34,'Unregistered Fingerprint','eUnregisteredFP','Events that are triggered when any fingerprints are not registered in the system or registered but not synchronized to the device.'),
(37,'Failed to Close during Normal Open Time Zone','eFailCloseNormalOpenTimezone','Abnormal events that are triggered when any person fails to close the door in NO state by calling ControlDevice.'),
(101,'Duress Password Open','eDuressPasswordOpen','Use the duress password of current door verified and triggered alarm event.'),
(102,'Opened Accidentally','eOpenAccidentally','Except all the normal events (normal events such as user with door open permission to punch card and open the door, password open door, open the door at normally open period, remote door open, the linkage triggered door open), the door sensor detect the door is opened, that is the door is unexpectedly opened.'),
(103,'Duress Fingerprint Open','eDuressFPOpen','Use the duress fingerprint of current door verified and triggered alarm event.'),
(200,'Door Opened Correctly','eDoorOpenedCorrectly','When the door sensor detects that the door has been properly opened, triggering this normal event.'),
(201,'Door Closed Correctly','eDoorClosedCorrectly','When the door sensor detects that the door has been properly closed, triggering this normal event.'),
(202,'Exit button Open','eExitButtonOpen','User press the exit button to open the door within the door valid time zone, and trigger this normal event.'),
(203,'Multi-Card Open (Card plus Fingerprint)','eMultiCardOpen_CardPlusFP','Normal events that are triggered when any person passes the verification with his card and fingerprint in multi-card access mode.'),
(204,'Normal Open Time Zone Over','eNormalOpenTimezoneOver','After the setting normal open time zone, the door will close automatically. The normal open time zone include the normal open time zone in door setting and the selected normal open time zone in first card setting.'),
(205,'Remote Normal Opening','eRemoteNormalOpening','Normal events that are triggered when the door is set to the NO state for remote opening operations.'),
(206,'Device Start','eDeviceStart','When the device is being activated, this normal event is triggered.'),
(220,'Auxiliary Input Disconnected','eAuxiliaryInputDisconnected','When any auxiliary input point breaks down, this normal event is triggered.'),
(221,'Auxiliary Input Shorted','eAuxiliaryInputShorted','When any auxiliary input point has short circuited, this normal event is triggered.'),
(255,'Door Alarm','eDoorAlarm','Door Alarm'),
(300,'Lost/Stolen Card','eLostStolenCard','Lost/Stolen Card'),
(301,'Connected','Connected','Connected'),
(302,'Disconnected','Disconnected','Disconnected');

